import React from "react";
import { Modal, Form, Typography, Input, InputNumber } from "antd";
import Column from "antd/lib/table/Column";
const PersonModal = ({
  form,
  Row,
  Col,
  visible,
  data,
  onCancel,
  onhandleUpdate
}) => {
  return (
    <Modal visible={visible} onCancel={onCancel} onOk={onhandleUpdate}>
      <Form
        hideRequiredMark
        form={form}
        layout="vertical"
        name="form_in_modal"
        initialValues={{
          id: data.id,
          first_name: data.first_name,
          last_name: data.last_name
        }}
      >
        <Form.Item name="id">
          <Typography level={4}>Edit Person Items</Typography>
        </Form.Item>

        <Form.Item
          name="first_name"
          label="First Name"
          rules={[
            {
              required: true,
              message: "Please input the First Name!"
            }
          ]}
        >
          <Input />
        </Form.Item>

        <Form.Item
          name="last_name"
          label="Last Name"
          rules={[
            {
              required: true,
              message: "Please input the Last Name!"
            }
          ]}
        >
          <Input />
        </Form.Item>
      </Form>
    </Modal>
  );
};

export default PersonModal;
